import React from 'react';
import { BrowserRouter, Route, Link, Switch } from 'react-router-dom';
import Nomination from './Nomination';
import Landing from './Landing';

const App = () => {
    return (
        <div>
            <Switch>
                <Route path="/">
                    <Landing />
                </Route>
                <Route path="/nomination">
                    <Nomination />
                </Route>
            </Switch>
        </div>
    );
};

export default App;
